チーズをビスケットではさんで硬めに焼き上げたおやつです。
<BR><BR>
<FONT SIZE="2" COLOR="#FF0000">
◎ラクトフェリン配合</FONT><BR>（免疫力を高めます）<BR><br>
<FONT SIZE="2" COLOR="#FF0000">
◎シャンピニオン配合</FONT><BR>（便臭・尿臭を抑えます）<BR><BR>
