バニーベイシックス／Ｔ　4.5kgの商品名及びパッケージが変更となりました。<Br><Br>≪1歳以上のうさぎ用≫<BR><BR>1才以上のうさぎ用のフードです。<BR>アルファルファは一切使用しておりません。<BR><Br>
健康的な生活に欠かせない栄養素。<Br>
兎の成長期には、成長段階に合わせた栄養素が必要です。<Br>
栄養バランスの整った等製品には、高繊維成分が含まれ、うさぎの健康維持をサポートします。<Br><Br>
【与え方】<Br>
体重：1.5kg未満・・・20g<Br>
体重：1.5～3.1kg・・・41～55g<Br>
体重：3.1～4.5kg・・・55～82g<Br>
体重：4.5kg以上・・・124g<Br>
※その他に牧草は十分与えて下さい。<Br><Br>
【初めてご使用のお客様】<Br>
・第1週目：新しいフードが1/4、現在与えているフード3/4になるように混ぜます。<Br>
・第2週目：新しいフードが1/2、現在のフード1/2になるように混ぜます。<Br>
・第3週目：新たらしいフードが3/4、現在のフード1/4になるように混ぜます。<Br>
・第4週目には新たしいフードのみです。<Br><Br>
【内容量】4.5kg (10lb.)　<br><br>

【成分】<br>
・粗タンパク質：14％<br>
・粗脂肪：2％<br>
・粗繊維：25％～29％<br>
・水分：10％<br>
・カルシウム：0.35％～0.75％<br>
・リン：0.25％<br>
・ビタミンA、IU/kg：10,000<br>
・ビタミンD3、IU/kg：900<br>
・ビタミンE、IU/kg：190<Br><Br>
【賞味期限】パッケージに記載<br><br>
